import { Box } from "@mui/material";
import { DataGrid, GridToolbar } from "@mui/x-data-grid";
import { tokens } from "../../theme";
import Header from "../../components/Header";
import { useTheme } from "@mui/material";
import { useState, useEffect } from "react";
import axios from "axios";

import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TablePagination from '@mui/material/TablePagination';
import TableRow from '@mui/material/TableRow';
import { withStyles, makeStyles } from "@mui/material/styles";

const StyledTableCell = withStyles((theme) => ({
  head: {
    backgroundColor: theme.palette.common.black,
    color: theme.palette.common.white,
  },
  body: {
    fontSize: 14,
  },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
  root: {
    "&:nth-of-type(odd)": {
      backgroundColor: theme.palette.action.hover,
    },
  },
}))(TableRow);

const useStyles = makeStyles({
  table: {
    minWidth: 700,
  },
});

// const columns = [
//   { field: "voltagelevel", headerName: "Voltage Level (KV)", flex: 2.5 },
//   { field: "ckt", headerName: "Circuit (KM)" , flex:2.5},
//   {
//     field: "nolines",
//     headerName: "No of Lines",
//     flex: 2.5,
//   }, 
// ];


const DamagedTransformer = () => {
  const theme = useTheme();
  const colors = tokens(theme.palette.mode);
  const classes = useStyles();

//   const[tableData,setTableData] = useState([]);
//   useEffect(()=> {
//     try {
//       const response = fetch("http://localhost:3001/tb");
//       const jsonData = response.json();
//       console.log(jsonData);
//       setTableData(jsonData);
//     }catch(err){
//       console.error(err.message);
//     }
//   },[])
// console.log(tableData)
const[tableData,setTableData] = useState([]);
const[search, setSearch] = useState("");

const gettb= async () => {
try{
const data = await axios.get("http://localhost:3001/tb");
console.log(data.data);
setTableData(data.data);
} catch (e) {
  console.log(e);
}
};
useEffect(()=>{
  gettb();
},[]);


  return (
    <Box m="20px">
      <Header
        title="DAMAGED TRANSFORMER "
        subtitle="Damaged Transformer  Details"
      />

      <h3> Table Data</h3>
      <input
        type="text"
        placeholder="Search here"
        onChange={(e) => {
          setSearch(e.target.value);
        }}
      />
      {tableData.map((item)=>{
        return (
          <p>
            {item.voltagelevel}=>{item.ckt}
          </p>
        )
      })}
      </Box>
  );
    };

 
<TableContainer component={Paper}>
        <Table className={classes.table} aria-label="customized table">
          <TableHead>
            <TableRow>
              <StyledTableCell>Voltage Level</StyledTableCell>
              <StyledTableCell align="right">CKT</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>

      {tableData
      .filter((item)=> {
        if (search === ""){
          return item;
        } else if(
          item.voltagelevel.toLowerCase().includes(search.toLowerCase())
        ){
          return item
        }
      })
      .map((item) =>{

     return (
             <StyledTableRow key={item.voltagelevel}>
                    <StyledTableCell component="th" scope="row">
                      {item.voltagelevel}
                    </StyledTableCell>
                    <StyledTableCell align="right">
                      {item.ckt}
                    </StyledTableCell>
                  </StyledTableRow>
                );
              })}
          </TableBody>
        </Table>
      </TableContainer>
//       </Box>
//   );
// };
     
        {/* <DataGrid
          rows={tableData}
          columns={columns}
          components={{ Toolbar: GridToolbar }}
          
        /> */}
       
      

export default DamagedTransformer;
